MyLanViewer Network/IP Scanner is a powerful Netbios and Network/IP scanner for LAN, whois and traceroute tool, remote shutdown and Wake-On-Lan (WOL) manager, LAN messenger and network monitor. The program displays your network computers in an easy to read, buddy-list style window that provides the machine names, IP addresses, MAC addresses, shared resources and other technical details for each computer. 

MyLanViewer Network/IP Scanner supports remote shutdown, wake-on-lan, lock workstation, log off, sleep, hibernate, reboot and power off It is able to monitor IP and show notifications when the states of some computers change. MyLanViewer Network/IP Scanner can also view and access shared folders, terminate user sessions disable shared resources, show netstat information and detect rogue DHCP servers. 

It can monitor all devices on your subnet and show notifications when the new devices will be found (for example, to know who is connected to your WiFi router or wireless network). The program easy to install and use, and has a user-friendly and beautiful interface.


